import React from "react";
import { useRouteError } from "react-router-dom";
import Header from "../../components/Header/Header";

const Error = () => {
  const error = useRouteError()
        return (
          <div className="">
            <Header/>
            <div className="container">
                <div className="errors">
                  <h1>{error.status}</h1>
                  <h1>{error.data}</h1>
                </div>            
            </div>
          </div>
         
           
        
        )
}
  export default Error;
